                        const myDict = {
                            warehouse: res.warehouse,
                            courier: res.name_id,
                            types: Object.keys(res.shipping_table)
                        }
                        setShipping(prevShipping => [...prevShipping, myDict]);
                        //needs to set the data, but also keep in mind whcih ids we have... also affects the types
                    })
                }
            }
            catch (error) {
            }
        }

